export const footer_social_media_links = pgTable(
  "footer_social_media_links",
  {
    _order: integer("_order").notNull(),
    _parentID: integer("_parent_id").notNull(),
    id: varchar("id").primaryKey(),
    socialMedia:
      enum_footer_social_media_links_social_media("social_media").notNull(),
    url: varchar("url").notNull(),
  },
  (columns) => ({
    _orderIdx: index("footer_social_media_links_order_idx").on(columns._order),
    _parentIDIdx: index("footer_social_media_links_parent_id_idx").on(
      columns._parentID,
    ),
    _parentIDFk: foreignKey({
      columns: [columns["_parentID"]],
      foreignColumns: [footer.id],
      name: "footer_social_media_links_parent_id_fk",
    }).onDelete("cascade"),
  }),
);

export const footer = pgTable("footer", {
  id: serial("id").primaryKey(),
  copyrightText: varchar("copyright_text").default(
    "Copyright 2025 Â© Best Pizza Malta",
  ),
  updatedAt: timestamp("updated_at", {
    mode: "string",
    withTimezone: true,
    precision: 3,
  }),
  createdAt: timestamp("created_at", {
    mode: "string",
    withTimezone: true,
    precision: 3,
  }),
});

export const site = pgTable(
  "site",
  {
    id: serial("id").primaryKey(),
    logo: integer("logo_id").references(() => media.id, {
      onDelete: "set null",
    }),
    favicon: integer("favicon_id").references(() => media.id, {
      onDelete: "set null",
    }),
    googleVerificationCode: varchar("google_verification_code"),
    googleTagManagerId: varchar("google_tag_manager_id"),
    googleAnalyticsId: varchar("google_analytics_id"),
    cookieConsentBannerEnabled: boolean("cookie_consent_banner_enabled"),
    acceptButtonLabel: varchar("accept_button_label")
      .notNull()
      .default("Accept All"),
    rejectButtonLabel: varchar("reject_button_label")
      .notNull()
      .default("Reject All"),
    cookieConsentBannerContent: jsonb("cookie_consent_banner_content"),
    updatedAt: timestamp("updated_at", {
      mode: "string",
      withTimezone: true,
      precision: 3,
    }),
    createdAt: timestamp("created_at", {
      mode: "string",
      withTimezone: true,
      precision: 3,
    }),
  },
  (columns) => ({
    site_logo_idx: index("site_logo_idx").on(columns.logo),
    site_favicon_idx: index("site_favicon_idx").on(columns.favicon),
  }),
);

